  false,\n\t\"url\": null,\n\t\"notes\": \"This spreadsheet contains Heat Flow observational
  data compiled by the University of North Dakota, published as a Web feature service,
  a Web map service, an ESRI service, and as a downloadable Excel spreadsheet for
  the National Geothermal Data System. The provided downloadable document contains
  6 worksheets including information about the template, notes related to revisions
  of the template, resource provider information, the data, and a field list (data
  mapping view). Data from 52 wells are included. Fields include Thermal Conductivity,
  Gradient, Heat Flow, and Heat Flow Correction Method for each observation.\",\n\t\"license_title\":
